import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Dashboard from './dashboard';

function App() {
  return(
    <div>
      Hello world!
    <Router>
    <Route path="/" exact component={Dashboard}/>
    </Router>
    </div>
  )

}

export default App;
